// region Math
function aceChanger() {
    if (startingCard1 === 11 || startingCard2 === 11) {
        if (startingCard1 === 11) {
            let aceValue = +prompt("Do you want the ace to be 11 or 1");
            while (aceValue !== 1 && aceValue !== 11) {
                aceValue = +prompt("Do you want the ace to be 11 or 1");
            }
            if (aceValue === 11) {
                startingCard1 = 11;
            } else if (aceValue === 1) {
                startingCard1 = 1;
            }
        }
        if (startingCard2 === 11) {
            let aceValue2 = +prompt("Do you want the ace to be 11 or 1");
            while (aceValue2 !== 1 && aceValue2 !== 11) {
                aceValue2 = +prompt("Do you want the ace to be 11 or 1");
            }
            if (aceValue2 === 11) {
                startingCard2 = 11;
            } else if (aceValue2 === 1) {
                startingCard2 = 1;
            }
        }
    }
}
function hit() {
    newCard = Math.floor((Math.random() * 11) + 1);
    NCValue.push(newCard);
    console.log("Hit");
    console.log(`${newCard}`);
    updateTotal();
    addCard();
    addAICard();
    if (total >= 21) {
        endGame();
    }
}

function stand() {
    console.log("Stay");
    revealAICards();
    endGame();
}

function deal() {
    console.log("Deal")
    console.log(`${startingCard1} and ${startingCard2}`);
    clearHidden();
    addStartingHand();
    aceChanger();
    updateTotal();
    runAI();
    if (startingCard1 + startingCard2 === 21){
        endGame();
    }
}
function restart() {
    console.clear();
    console.log("Restarted");
    startingCard1 = Math.floor((Math.random() * 11) + 1);
    startingCard2 = Math.floor((Math.random() * 11) + 1);
    total = 0;
    newCard = 0;
    hitButton.classList.add('hidden');
    stayButton.classList.add('hidden');
    dealButton.classList.remove('hidden');
    NCValue = [];
}

function clearHidden() {
    hitButton.classList.remove('hidden');
    stayButton.classList.remove('hidden');
    dealButton.classList.add('hidden');
}
function endGame(){
    hitButton.classList.add('hidden');
    stayButton.classList.add('hidden');
    dealButton.classList.add('hidden');
    revealAICards();
    revealAllAICards();
    if(total > otherTotal && total <= 21 || otherTotal > 21 && total <= 21) {
        alert('You Win!');
    }
    else if(otherTotal === total){
        alert('You Tied!')
    }
    else {
        alert('You Lost! :(')
    }

}
function updateTotal(){
    const totalElement = document.querySelector('.total');
    total = startingCard1 + startingCard2;
    for (let i = 0; i < NCValue.length; i++) {
        total += NCValue[i];
    }
    totalElement.textContent = `Total: ${total}`;
    console.log(total);
}
