//region AI
function runAI() {
    generateAiCards();
    if (aiCardStartingTotal === 0) {
        otherTotal = aiCardStartingTotal;
        for (let i = 0; i < aiNCValue.length; i++) {
            otherTotal += aiNCValue[i];
        }
    }

    // Continue to draw cards while total is less than or equal to 16
    while (otherTotal <= 16) {
        let aiNewCard = Math.floor((Math.random() * 11) + 1);
        aiNCValue.push(aiNewCard);
        otherTotal += aiNewCard; // Update total
        console.log(`${aiNewCard}`);
        console.log("AI Hit");
    }

    // Once total is 17 or higher, AI should stop drawing cards
    if (otherTotal >= 17) {
        console.log("AI Stay");
        console.log(`Other Total: ${otherTotal}`);
    }
}

